import { MDCTopAppBar } from "@material/top-app-bar";
import { MDCDialog } from "@material/dialog";
import { useEffect } from "react";

// Instantiation

export default function MWCTopAppBar() {
  let topAppBar = null;

  useEffect(() => {
    const topAppBarElement = document.querySelector(".mdc-top-app-bar");
    if (topAppBar === null) {
      topAppBar = new MDCTopAppBar(topAppBarElement);
    }
  }, []);
  const open_dialog = () => {
    const dialog = new MDCDialog(document.querySelector(".mdc-dialog"));
    dialog.open();
  };

  return (
    <header className="mdc-top-app-bar">
      <div className="mdc-top-app-bar__row">
        <section className="mdc-top-app-bar__section mdc-top-app-bar__section--align-start">
          <button
            className="material-icons mdc-top-app-bar__navigation-icon mdc-icon-button focus:outline-none"
            aria-label="Open navigation menu"
          >
            menu
          </button>
          <span className="mdc-top-app-bar__title">Page title</span>
        </section>
        <section
          className="mdc-top-app-bar__section mdc-top-app-bar__section--align-end"
          role="toolbar"
        >
          <button
            className="material-icons mdc-top-app-bar__action-item mdc-icon-button focus:outline-none"
            aria-label="Favorite"
          >
            favorite
          </button>
          <button
            className="material-icons mdc-top-app-bar__action-item mdc-icon-button focus:outline-none"
            aria-label="Search"
            onClick={() => open_dialog()}
          >
            search
          </button>
          <button
            className="material-icons mdc-top-app-bar__action-item mdc-icon-button focus:outline-none"
            aria-label="Options"
          >
            more_vert
          </button>
        </section>
      </div>
    </header>
  );
}
